def main():    win = GraphWin("Aim Lab", 300, 300)    win.setBackground("black")    for i in range(5):        r = random.randrange(256)        g = random.randrange(256)        b = random.randrange(256)        color = color_rgb(r, g, b)        circle1 = Circle(Point(random.randrange(10,290), random.randrange(10,290)), 10)        circle1.setFill(color)        circle1.draw(win)        sleep(5)        circle1.undraw()        win.getMouse()    win.close()    main()print("test")